  \"2016-10-12T11:56:45.788456\",\n\t\"name\": \"public-land-survey-system-iowa-sections\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Public Land Survey System (PLSS) is
  a way of subdividing and describing land in the United States.  The PLSS typically
  divides land into 6-mile-square townships. Each township is identified with a township
  and range designation. Township designations indicate the location north or south
  of the baseline, and range designations indicate the location east or west of the
  Principal Meridian. Townships are subdivided into 36 one-mile- square sections,
  which are displayed on this map.  NOTE: Sections are only visible when zoomed into
  a portion of the state.rnrnWarning: This dataset may not reflect legal boundary.\",\n\t\"license_title\":
